import React, { Component } from 'react'

class Header extends Component {
  render() {
    return (
      <div style = {
           headerStyle
      }>
        <p>Header</p>
      </div>
    )
  }
}
const headerStyle = {
    backgroundColor: '#00B951',
    height: '66px',
}

export default  Header;
